import React from "react";
import { CssBaseline } from "@material-ui/core";
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';
import { makeStyles } from '@material-ui/core/styles';
import wallpaper from "../components/images/wallpaper.jpeg";


const useStyles = makeStyles((theme) => ({
  root: {
    minHeight: '100vh',
    backgroundImage: `url(${process.env.PUBLIC_URL + '/images/bg.jpeg'})`,
    backgroundRepeat: 'no-repeat',
    backgroundSize: 'cover'
  },
  homeImage: {
    width: '110%', /* width of container */
    height: '110%', /* height of container */
    objectFit: 'cover'
  },
  homeText: {
    position: 'absolute',
    top: '25%',
    left: '15%',
    color: 'white'

  },
  homeTextName:
  {
    color: "white",
    fontSize: '6vw',
  },
  homeTextName:
  {
    color: "white",
    fontSize: '3vw',
  }

}));

const Home = () => {
  const classes = useStyles();

  return (
    <React.Fragment>
      <CssBaseline />
      <div className={classes.root}>
        <Container maxWidth="md" className="homeText">
          <img src={wallpaper} alt="Wallpaper" className={classes.homeImage} />
          <Typography className="homeTextName">Hey There.</Typography>
          <Typography className="homeTextTitle">Wanna Join the "fur-ty?</Typography>
        </Container>
      </div>
    </React.Fragment>
  );
}

export default Home;
